package cleanhttp

import (
	"io"
	"strings"
	"testing"

	"github.com/Implex-ltd/cleanhttp/cleanhttp"
)

func TestCalculateContentLength(t *testing.T) {
	type args struct {
		reader io.Reader
	}
	tests := []struct {
		name    string
		args    args
		want    int64
		wantErr bool
	}{
		{
			name: "json-payload",
			args: args{
				reader: strings.NewReader(`{"content": "my super json !"}`),
			},
			want: 30,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			got, err := cleanhttp.CalculateContentLength(tt.args.reader)
			if (err != nil) != tt.wantErr {
				t.Errorf("CalculateContentLength() error = %v, wantErr %v", err, tt.wantErr)
				return
			}
			if got != tt.want {
				t.Errorf("CalculateContentLength() = %v, want %v", got, tt.want)
			}
		})
	}
}

func TestImageToBase64(t *testing.T) {
	type args struct {
		filePath string
	}
	tests := []struct {
		name    string
		args    args
		want    string
		wantErr bool
	}{
		{
			name: "palo.png",
			args: args{
				filePath: "../assets/pablo.png",
			},
			want: `data:image/png;base64,`,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			got, err := cleanhttp.ImageToBase64(tt.args.filePath)
			if (err != nil) != tt.wantErr {
				t.Errorf("ImageToBase64() error = %v, wantErr %v", err, tt.wantErr)
				return
			}
			if got != tt.want {
				t.Errorf("ImageToBase64() = %v, want %v", got, tt.want)
			}
		})
	}
}
